  //经纬度转换成三角函数中度分表形式。
  rad(d) {
    return d * Math.PI / 180.0;
  },
  //输出为公里
  //args.lat1 纬度1
  //args.lng1 经度1
  //args.lat2 纬度2
  //args.lng2 经度2
  async getDistance(args) {
    args.lat1 = Number(args.lat1)
    args.lng1 = Number(args.lng1)
    if (args.lat2 && args.lng2) { } else {
      // location = await utils.api.native.user.getLocation({
      //   loadType: -1
      // })
      // if (!location) {
      //   utils.api.native.face.showModal({
      //     content: args.contentText?args.contentText:'请先开启定位',
      //     confirmText:'去开启',
      //     success(res) {
      //       if (res.confirm) {
      //         wx.openSetting({
      //         })
      //       } else if (res.cancel) {
      //       }
      //     }
      //   })    
      //   return false
      // }
      // args.lat2 = location.latitude
      // args.lng2 = location.longitude
    }
    let radLat1 = this.rad(args.lat1);
    let radLat2 = this.rad(args.lat2);
    let a = radLat1 - radLat2;
    let b = this.rad(args.lng1) - this.rad(args.lng2);
    let s = 2 * Math.asin(Math.sqrt(Math.pow(Math.sin(a / 2), 2) +
      Math.cos(radLat1) * Math.cos(radLat2) * Math.pow(Math.sin(b / 2), 2)));
    s = s * 6378.137; // EARTH_RADIUS;
    s = Math.round(s * 10000) / 10000;
    //s=s.toFixed(4);
    return s;
  },
